import React from 'react';
import { Link,BrowserRouter as Router } from 'react-router-dom'

class MenuBar extends React.Component {
  render() {
    return (
      <section className="section-menubar">

          <Link to="/">Home</Link>
          <Link to="/login">Login</Link>
      </section>
    );

}
}

export default MenuBar;
